import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>MowGrass-IT</h1>
      <a href="/">Récupérer le sujet</a>
      <button type="button" className="btn btn-primary">
        Primary
      </button>
    </div>
  );
}

export default App;
